import React from "react";
import {Container, Row, Col, Card} from 'react-bootstrap'

const Server = () => {
    return (
        <Container>
        <Row className="mt-2"> 
            <Col md = {3}>
                <Card>
                    Общая информация
                </Card>
            </Col>
            <Col md = {9}>
                <Card>
                    Иноформация о машинах

                </Card>
            </Col>
        </Row>
    </Container>
    );
};

export default Server;
